import React from "react"

export default function Calculator() {
    return (
        <><h1>Quiz</h1><iframe
            width="710"
            height="1300"
            frameborder="0"
            marginwidth="0"
            marginheight="0"
            scrolling="no"
            src="https://calculator.carbonfootprint.com/calculator.aspx">
        </iframe></>
    );

}
